import { FiHelpCircle, FiSettings, FiUser } from 'react-icons/fi';

const Header: React.FC = () => {
  return (
    <header className="bg-gradient-to-b from-primary-blue to-secondary-blue p-4 flex justify-between items-center">
      <h1 className="text-white text-xl font-bold font-poppins">
        AutoWhapp
      </h1>
      <div className="bg-[#153E6F] p-2 rounded-lg flex gap-2">
        <button className="bg-gray-200 h-10 w-10 flex items-center justify-center rounded-full hover:bg-blue-300 hover:scale-110 hover:shadow-lg transition-all duration-300">
          <FiHelpCircle className="text-gray-800 h-5 w-5 hover:text-blue-800" />
        </button>
        <button className="bg-gray-200 h-10 w-10 flex items-center justify-center rounded-full hover:bg-blue-300 hover:scale-110 hover:shadow-lg transition-all duration-300">
          <FiSettings className="text-gray-800 h-5 w-5 hover:text-blue-800" />
        </button>
        <button className="bg-gray-200 h-10 w-10 flex items-center justify-center rounded-full hover:bg-blue-300 hover:scale-110 hover:shadow-lg transition-all duration-300">
          <FiUser className="text-gray-800 h-5 w-5 hover:text-blue-800" />
        </button>
      </div>
    </header>
  );
};

export default Header;
